import React from 'react';
import PropTypes from 'prop-types';
import './AppBar.css' //para manejar su css

AppBar.propTypes = { //los props deben aceptar solo estos tipos 
    title: PropTypes.string, 
    subtitle: PropTypes.string
};

function tiempo(){
    const date = new Date();
    const hora = date.getHours() +":";
    const minutos = date.getMinutes();
   const segundos = date.getSeconds();

}


function AppBar({title="TITULO", subtitle="Subtitle", tiempo, ...props}) { //...props: que jale todos los props que tienen los componentes por default (los va a tener disponibles pero no guardados)
    //si no le mandamos los parametros, que utilice los que tiene por default
    
    return (
        <div className="appbar">
            <h1> {title} </h1>
            <h4>{subtitle} </h4>
            <h4>{tiempo} </h4>
            </div>    
    );
}

export default AppBar;
